histo = zeros(12, 1);
histoInd = 1;

for i=0:11
    
    img = read(Tiff(sprintf('c:/work/t4/build/bin/rot-0-360/%d.tif', i), 'r'));
    img = double(img);    

    %profile = img(1304:1308, 1421);
    profile = img(1305, 1419:1423);

    [r, ind] = min(profile);
    neighAvg = (profile(ind-1)+profile(ind+1))/2;
    closeInd = ind-1;
    if (profile(ind+1) < profile(ind-1))
        closeInd = ind+1;
    end

    addition = (abs(neighAvg - profile(closeInd)) / (neighAvg - r)) * 0.5;

    if (profile(ind+1) < profile(ind-1))
        ind = ind + addition;
    else    
        ind = ind - addition;
    end

    histo(histoInd) = ind;
    histoInd = histoInd + 1;
end

[d] = histogram(histo);
xlim([1 5]);


xticklabels(1419:1423);
xlabel('Pixels (Y-direction)');
ylabel('Measures, N');

